    false,nt"url": null,nt"notes": "This dataset consists of CRAMP surveys
    taken in 2007 from 9 sites on Maui, 3 sites on Molokai, and 1 site on Kauai. Sites
    typical have two transects along different isobaths, shallow (~3m) and deep (~10m)
    lines. Quantitative estimates of substrate type and species were acquired. The types
    and coverages were derived objectively from photographic images using PhotoGrid,
    a software package which analyzes random points on digital still images of coral
    reefs and substrate. This dataset does not include the images from the transects,
    which have been provided to NOAA separately.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
